def fast_s(n):

    def factorize(n):
        i = 3
        factors = []
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                factors.append(i)
        if n > 1:
            factors.append(n)
        return factors

    def get_divisors(n):
        factors = factorize(n)
        product = [1]
        for i in factors:
            product = product + [x * i for x in product]
        return sorted(list(set(product)))

    def f_approx(r):
        return int((3.208 * r - 36.97) * r + 190)
    divisors = get_divisors(n)
    return sum((f_approx(r) for r in divisors if r * r <= n))

